import React, { useRef } from "react";
import { CSVLink } from "react-csv";

export default function BatchResults({ results }) {
  const csvRef = useRef();
  if (!results || results.length === 0) return null;
  return (
    <div className="mt-4 p-4 bg-white rounded shadow">
      <h3 className="font-semibold mb-4">Batch Prediction Results</h3>
      <button
        className="mb-4 px-4 py-2 bg-green-600 text-white rounded hover:bg-green-700"
        onClick={() => csvRef.current.link.click()}
      >
        Download CSV
      </button>
      <table className="w-full border-collapse border border-gray-300">
        <thead>
          <tr>
            {Object.keys(results[0]).map(k => (
              <th key={k} className="border border-gray-300 px-2 py-1 text-left bg-gray-100">{k}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {results.map((row, i) => (
            <tr key={i} className={i % 2 === 0 ? "bg-gray-50" : ""}>
              {Object.values(row).map((v, j) => (
                <td key={j} className="border border-gray-300 px-2 py-1">{v}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
      <CSVLink
        data={results}
        filename="batch_predictions.csv"
        className="hidden"
        ref={csvRef}
        target="_blank"
      />
    </div>
  );
}
